import React, { useEffect, useState } from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
  useLocation,
} from "react-router-dom";

import Header from "./components/Header";
import BackgroundVideo from "./components/BackgroundVideo";
import ArtistDashboard from "./components/board/ArtistDashboard";
import UserDashboard from "./components/board/UserDashboard";
import Profile from "./components/board/Profile";
import Login from "./components/auth/Login";
import Register from "./components/auth/Register";

function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}

function AppContent() {
  const location = useLocation();
  const [token, setToken] = useState(null);
  const [role, setRole] = useState("");

  useEffect(() => {
    const storedToken = localStorage.getItem("token");
    const storedRole = localStorage.getItem("role");
    if (storedToken && storedRole) {
      setToken(storedToken);
      setRole(storedRole.toLowerCase());
    }
  }, []);

  const isLoginOrRegister =
    location.pathname === "/login" || location.pathname === "/register";

  return (
    <div className="app-container">
      {isLoginOrRegister && <BackgroundVideo />}
      <Header />

      <Switch>
        {/* üöÄ Default route based on login + role */}
        <Route exact path="/">
          {token ? (
            role === "artist" ? (
              <Redirect to="/artist-dashboard" />
            ) : (
              <Redirect to="/dashboard" />
            )
          ) : (
            <Redirect to="/login" />
          )}
        </Route>

        {/* üîê Auth Routes */}
        <Route exact path="/login" component={Login} />
        <Route exact path="/register" component={Register} />

        {/* üé® Artist Dashboard (role = artist) */}
        <Route
          exact
          path="/artist-dashboard"
          render={(props) =>
            token && role === "artist" ? (
              <ArtistDashboard {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* üõçÔ∏è User Dashboard (role = buyer) */}
        <Route
          exact
          path="/dashboard"
          render={(props) =>
            token && role === "buyer" ? (
              <UserDashboard {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* üë§ Artist Profile (artist only) */}
        <Route
          exact
          path="/profile"
          render={(props) =>
            token && role === "artist" ? (
              <Profile {...props} />
            ) : (
              <Redirect to="/login" />
            )
          }
        />

        {/* ‚ùå 404 - Catch All */}
        <Route path="*">
          <div className="text-center py-10">
            <h2 className="text-3xl font-bold text-red-500">
              404 - Page Not Found
            </h2>
          </div>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
